// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import '@openzeppelin/contracts/token/ERC20/ERC20.sol';
import '@openzeppelin/contracts/access/Ownable.sol';

contract GOOToken is ERC20, Ownable {
    uint256 public startTime; 
    uint256 public endTime; 
    uint256 public amount = 100000; 
    uint256 public tokenPrice = 500000000 wei; 
    uint256 public airdropPool = 85818234000;
    uint256 public presalePool = 57212156000;
    // uint256 private allTokens = 143030390000;
    //tokenov in 1 eth = 2000000000


    mapping(address => bool) private claimed;
    mapping(address => uint) public bought;

    constructor() ERC20("GOO", "GO") {
        _mint(address(this), 143030390000);

        startTime = block.timestamp;
        endTime = block.timestamp + 1 days;
    }

    function retBal() external view returns(uint){
        return balanceOf(address(this));
    }

    // function decimals() public view virtual override returns (uint8) {
    //     return 18;
    // }

    function claim(address referral) public returns (bool success){
        require(startTime <= block.timestamp && block.timestamp <= endTime);
        require(!claimed[msg.sender], 'CLAIMONCE');

        if(msg.sender != referral && balanceOf(referral) != 0 && referral != address(0)){
            _transfer(address(this), referral, amount);

            airdropPool = airdropPool - amount;
        } 
        _transfer(address(this), msg.sender, amount);

        airdropPool = airdropPool - amount;

        claimed[msg.sender] = true;
        return true;
        
      }


    function testTok() external payable returns(uint tokens){
        tokens = msg.value / tokenPrice;
        return tokens;
    }
      
    function tokenSale(address referral) public payable returns (bool){
        require(bought[msg.sender] <= 1 ether, "MAXLIMIT");
        require(msg.value >= 5000000000000000 wei, "MINPRICE");
        require(startTime <= block.timestamp && block.timestamp <= endTime);
        require(bought[msg.sender] + msg.value <= 1 ether, "UPPERBOUND");

        uint256 _eth = msg.value;
        uint256 tokens;
        uint256 tokensRef;

        tokens = _eth / tokenPrice; //2000000000
        tokensRef = (_eth / tokenPrice) / 100 * 6;


        if(msg.sender != referral && balanceOf(referral) != 0 && referral != 0x0000000000000000000000000000000000000000){
        
        _transfer(address(this), referral, tokensRef);
        }
        
        _transfer(address(this), msg.sender, tokens);
        bought[msg.sender] += msg.value;
        
        return true;
    }

    function viewAirdrop() public view returns(uint){
        return(1);
    }

    function viewSale() public view returns(uint){
        return(1);
    }
    
    function startAirdrop() public onlyOwner {
    }

    function startSale() public onlyOwner{

    }
    

    function clear(uint quantity) public onlyOwner {
        address payable _dev = payable(msg.sender);

        _dev.transfer(quantity);
    }
}

